function ChangeQuantity(props) {
    return (
        <div className='ChangeQuantity margin-auto'>
            <div className='add'>+
            </div>
            <p className='Quantity'>
                1
            </p>
            <div className='sub'>
                -
            </div>
        </div>
    );
}

export default ChangeQuantity;
